import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Index from "./Index";
import Dashboard from "./front_end/pages/Dash_board";
import Tables from "./pages/Tables";
import Billing from "./pages/Billing";
import VirtualReality from "./pages/VirtualReality";
import Rtl from "./pages/Rtl";
import Profile from "./pages/Profile";
import SignIn from "./pages/SignIn";
import SignUp from "./pages/SignUp";
// CSS Imports
import './App.css';
import './front_end/assets/css/nucleo-icons.css';
import './front_end/assets/css/nucleo-svg.css';
import './front_end/assets/css/argon-dashboard-tailwind.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

// Context Providers (if needed)
// import { ThemeProvider } from './context/ThemeContext';

function App() {
  return (
      <Router>
        <Routes>
          <Route path="/" element={<Index />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/tables" element={<Tables />} />
          <Route path="/billing" element={<Billing />} />
          <Route path="/virtual-reality" element={<VirtualReality />} />
          <Route path="/rtl" element={<Rtl />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/sign-in" element={<SignIn />} />
          <Route path="/sign-up" element={<SignUp />} />
        </Routes>
      </Router>
);
}

export default App;
